import Vue from 'vue';
import App from './App.vue';
import router from './router';  // Asegúrate de que el router esté importado

Vue.config.productionTip = false;

new Vue({
  router,  // Incluye el enrutador en la instancia principal
  render: h => h(App),
}).$mount('#app');
